import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom';


const cardData =[
  {
    image :"https://th.bing.com/th/id/OIP.UOOfzDdCC_RNNHn4xY-7PwHaIl?rs=1&pid=ImgDetMain",
    title : "Wedding Decor",
    path : "/Wedding Decor"
  },
  {
    image :"https://th.bing.com/th/id/OIP.ta7NBWO3BuyCym6HRphAPQHaLH?rs=1&pid=ImgDetMain",
    title : "Wedding Management",
    path : "/Wedding Management"
  },
  {
    image :"https://th.bing.com/th/id/OIP.RfK4XFntBFstpezSZ7lxUgHaHa?rs=1&pid=ImgDetMain",
    title :"Wedding Parties",
    path : "/Wedding Parties"
  },
  {
    image : "https://mavenprodcontent.blob.core.windows.net/media/LNSpecialEvents/Blog/August%202018/Overhead-floor-space-corp-event.jpg",
    title :"Product Launch",
    path : "/Product Launch"
  },
];
function Card() {

    const card = () => {
      const navigate = useNavigate();

      const handleCardClick = (path) => {
        navigate(path);
      };
     }
  return (
    <div className='card-container'>
      {cardData.map((card,index) =>(
        <div
        key={index}
        className='card'
        onClick={() => handleCardClick(Card.path)}
        style={{cursor :'pointer'}}
        >
          <img src={card.image} alt={card.title} className='card-image'></img>
          <div className="card-content">
            <h3 className='card-title'>{card.title}</h3>
          </div>
          </div>
      ))}
    </div>
  );
};

export default Card;
